import React from "react";
import Avatar from 'react-avatar';
import { Link } from "react-router-dom";

export default props => {
    return (

        <div className= "header">

            <nav>
            <input type="checkbox" class="checkbox" id="click" hidden></input>
            <label for="click">
            <div class="menu-icon">
              <div class="line line-1"></div>
              <div class="line line-2"></div>
              <div class="line line-3"></div>
            </div>
        </label>
      <div className="ava"> <Avatar name="Tesnor Carly" size="30" round={true} /></div>   
                <ul className="nav__links">

                    <li className="goch"><Link to="/" className="navigation-link">
              Home
            </Link></li>
                    <li className="droite"><a href="#">About</a></li>
                </ul>
            </nav>

        </div>

    );
};
